import React, { useEffect, useRef } from 'react'
import { useNavigate, useParams } from 'react-router-dom'
import EditNote from './editNote'
import Note from './Note'
function CardModal() {
  const navigate = useNavigate()
  const { id } = useParams()
  const buttonRef = useRef()

  const onClose = (e) => {
    e.stopPropagation()
    navigate(-1)
  }

//   useEffect(() => {
